// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

/**
 * @title MaticSwap
 * @dev A DEX contract that allows users to swap any ERC20 token for MATIC
 * using Uniswap V2 Router for price discovery and liquidity
 */
contract MaticSwap is ReentrancyGuard, Ownable {
    // Uniswap V2 Router interface
    IUniswapV2Router02 public immutable uniswapRouter;
    
    // WMATIC address on Polygon
    address public constant WMATIC = 0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270;
    
    // Minimum amount of MATIC to keep in contract for gas
    uint256 public constant MINIMUM_MATIC_RESERVE = 0.1 ether;
    
    // Events
    event TokenSwapped(
        address indexed user,
        address indexed tokenIn,
        uint256 amountIn,
        uint256 amountOutMatic
    );
    
    event LiquidityAdded(
        address indexed token,
        uint256 tokenAmount,
        uint256 maticAmount
    );
    
    event LiquidityRemoved(
        address indexed token,
        uint256 tokenAmount,
        uint256 maticAmount
    );

    /**
     * @dev Constructor sets the Uniswap V2 Router address and initializes Ownable
     * @param _uniswapRouter Address of Uniswap V2 Router on Polygon
     */
    constructor(address _uniswapRouter) Ownable(msg.sender) {
        require(_uniswapRouter != address(0), "Invalid router address");
        uniswapRouter = IUniswapV2Router02(_uniswapRouter);
    }
    
    /**
     * @dev Allows users to swap any ERC20 token for MATIC
     * @param tokenIn Address of token to swap
     * @param amountIn Amount of tokens to swap
     * @param minAmountOut Minimum amount of MATIC to receive
     * @return amountOut Amount of MATIC received
     */
    function swapTokenForMatic(
        address tokenIn,
        uint256 amountIn,
        uint256 minAmountOut
    ) external nonReentrant returns (uint256 amountOut) {
        require(tokenIn != address(0), "Invalid token address");
        require(amountIn > 0, "Amount must be greater than 0");
        
        // Transfer tokens from user to contract
        IERC20(tokenIn).transferFrom(msg.sender, address(this), amountIn);
        
        // Approve router to spend tokens
        IERC20(tokenIn).approve(address(uniswapRouter), amountIn);
        
        // Setup swap path
        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = WMATIC;
        
        // Get expected amount out
        uint256[] memory amounts = uniswapRouter.getAmountsOut(amountIn, path);
        require(amounts[1] >= minAmountOut, "Insufficient output amount");
        
        // Execute swap
        amounts = uniswapRouter.swapExactTokensForETH(
            amountIn,
            minAmountOut,
            path,
            msg.sender,
            block.timestamp
        );
        
        amountOut = amounts[1];
        emit TokenSwapped(msg.sender, tokenIn, amountIn, amountOut);
        
        return amountOut;
    }
    
    /**
     * @dev Get estimated MATIC output for token input
     * @param tokenIn Address of input token
     * @param amountIn Amount of input tokens
     * @return amountOut Expected MATIC output amount
     */
    function getEstimatedMaticOutput(
        address tokenIn,
        uint256 amountIn
    ) external view returns (uint256 amountOut) {
        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = WMATIC;
        
        uint256[] memory amounts = uniswapRouter.getAmountsOut(amountIn, path);
        return amounts[1];
    }
    
    /**
     * @dev Add liquidity to token-MATIC pair
     * @param token Address of token
     * @param tokenAmount Amount of tokens to add
     */
    function addLiquidity(
        address token,
        uint256 tokenAmount
    ) external payable nonReentrant onlyOwner {
        require(token != address(0), "Invalid token address");
        require(tokenAmount > 0, "Token amount must be greater than 0");
        require(msg.value > 0, "MATIC amount must be greater than 0");
        
        // Transfer tokens to contract
        IERC20(token).transferFrom(msg.sender, address(this), tokenAmount);
        
        // Approve router to spend tokens
        IERC20(token).approve(address(uniswapRouter), tokenAmount);
        
        // Add liquidity
        uniswapRouter.addLiquidityETH{value: msg.value}(
            token,
            tokenAmount,
            0, // Accept any amount of tokens
            0, // Accept any amount of MATIC
            owner(),
            block.timestamp
        );
        
        emit LiquidityAdded(token, tokenAmount, msg.value);
    }
    
    /**
     * @dev Remove liquidity from token-MATIC pair
     * @param token Address of token
     * @param liquidity Amount of liquidity tokens to remove
     */
    function removeLiquidity(
        address token,
        uint256 liquidity
    ) external nonReentrant onlyOwner {
        require(token != address(0), "Invalid token address");
        require(liquidity > 0, "Liquidity must be greater than 0");
        
        // Remove liquidity
        (uint256 tokenAmount, uint256 maticAmount) = uniswapRouter.removeLiquidityETH(
            token,
            liquidity,
            0, // Accept any amount of tokens
            0, // Accept any amount of MATIC
            owner(),
            block.timestamp
        );
        
        emit LiquidityRemoved(token, tokenAmount, maticAmount);
    }
    
    /**
     * @dev Withdraw MATIC from contract
     * @param amount Amount of MATIC to withdraw
     */
    function withdrawMatic(uint256 amount) external onlyOwner {
        require(
            address(this).balance >= amount + MINIMUM_MATIC_RESERVE,
            "Insufficient MATIC balance"
        );
        payable(owner()).transfer(amount);
    }
    
    /**
     * @dev Withdraw ERC20 tokens from contract
     * @param token Address of token to withdraw
     * @param amount Amount of tokens to withdraw
     */
    function withdrawToken(
        address token,
        uint256 amount
    ) external onlyOwner {
        require(token != address(0), "Invalid token address");
        IERC20(token).transfer(owner(), amount);
    }
    
    // Required to receive MATIC
    receive() external payable {}
}

contracts/NFTMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract NFTMarketplace is ERC721URIStorage, ReentrancyGuard {
    address payable owner;
    uint256 listingFee = 0.025 ether;
    uint256 private _tokenIds;
    uint256 private _propertyIds;
    uint256 private _propertiesSold;

    constructor() ERC721("Real Estate NFT", "RENFT") {
        owner = payable(msg.sender);
    }

    struct Property {
        uint256 propertyId;
        uint256 tokenId;
        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
        string propertyType;
        string propertyImage;
        uint256 squareFootage;
        string location;
    }

    mapping(uint256 => Property) private idToProperty;

    event PropertyListed(
        uint256 indexed propertyId,
        uint256 indexed tokenId,
        address seller,
        address owner,
        uint256 price,
        bool sold,
        string propertyType,
        string propertyImage,
        uint256 squareFootage,
        string location
    );

    function getListingFee() public view returns (uint256) {
        return listingFee;
    }

    function createToken(string memory tokenURI) public returns (uint256) {
        _tokenIds++;
        uint256 newTokenId = _tokenIds;

        _mint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);

        return newTokenId;
    }

    function listProperty(
        uint256 tokenId,
        uint256 price,
        string memory propertyType,
        string memory propertyImage,
        uint256 squareFootage,
        string memory location
    ) public payable nonReentrant {
        require(price > 0, "Price must be at least 1 wei");
        require(msg.value == listingFee, "Must pay the listing fee");
        require(ownerOf(tokenId) == msg.sender, "You can only list tokens you own");

        _propertyIds++;
        uint256 propertyId = _propertyIds;
  
        idToProperty[propertyId] = Property(
            propertyId,
            tokenId,
            payable(msg.sender),
            payable(address(0)),
            price,
            false,
            propertyType,
            propertyImage,
            squareFootage,
            location
        );

        _transfer(msg.sender, address(this), tokenId);

        emit PropertyListed(
            propertyId,
            tokenId,
            msg.sender,
            address(0),
            price,
            false,
            propertyType,
            propertyImage,
            squareFootage,
            location
        );
    }

    function buyProperty(uint256 propertyId) public payable nonReentrant {
        uint256 price = idToProperty[propertyId].price;
        uint256 tokenId = idToProperty[propertyId].tokenId;
        require(msg.value == price, "Please submit the asking price to complete the purchase");

        idToProperty[propertyId].seller.transfer(msg.value);
        _transfer(address(this), msg.sender, tokenId);
        idToProperty[propertyId].owner = payable(msg.sender);
        idToProperty[propertyId].sold = true;
        _propertiesSold++;
        payable(owner).transfer(listingFee);
    }

    function fetchAvailableProperties() public view returns (Property[] memory) {
        uint256 unsoldItemCount = _propertyIds - _propertiesSold;
        uint256 currentIndex = 0;

        Property[] memory properties = new Property[](unsoldItemCount);
        for (uint256 i = 1; i <= _propertyIds; i++) {
            if (idToProperty[i].owner == address(0)) {
                properties[currentIndex] = idToProperty[i];
                currentIndex++;
            }
        }
        return properties;
    }

    function fetchMyProperties() public view returns (Property[] memory) {
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 1; i <= _propertyIds; i++) {
            if (idToProperty[i].owner == msg.sender) {
                itemCount++;
            }
        }

        Property[] memory properties = new Property[](itemCount);
        for (uint256 i = 1; i <= _propertyIds; i++) {
            if (idToProperty[i].owner == msg.sender) {
                properties[currentIndex] = idToProperty[i];
                currentIndex++;
            }
        }
        return properties;
    }
}

